import React from 'react';
import styles from './css/SobreNosotros.module.css';

const SobreNosotros = () => {
  return (
    <div className={styles.container}>
      <h1 className={styles.title}>Sobre Nosotros</h1>
      <p className={styles.description}>
        Bienvenido a nuestra tienda. Nos especializamos en ofrecer las mejores joyas con diseño único y materiales de la más alta calidad. 
      </p>
      <p className={styles.description}>
        Nuestra misión es proporcionar a nuestros clientes piezas que no solo sean hermosas, sino también representativas de su estilo y personalidad.
      </p>
      <p className={styles.description}>
        Desde anillos hasta collares exclusivos, cada producto está diseñado con pasión y dedicación. Gracias por confiar en nosotros.
      </p>
    </div>
  );
};

export default SobreNosotros;
